INSERT INTO `Page` VALUES (1,'layout','About Us','/page/about','file','page/about.phtml','<div class=\"one-fourth\">\r\n	<!-- COLUMN STARTS--><img alt=\" \" class=\"img-align-left\" height=\"66\" src=\"/themes/adventure/images/icons/idea.png\" width=\"66\" />\r\n	<h4>\r\n		Our Vision</h4>\r\n	<p>\r\n		Lorem ipsum dolor sit amet, tollite fit manibus individuationis omnibus civitas ad quia. Quaere allocutus ait regem ut sua etiam quantitas non solutionem invenisti.</p>\r\n	<br />\r\n	<ul class=\"round-list\">\r\n		<li>\r\n			Site Redesign</li>\r\n		<li>\r\n			Custom CMS Developmet</li>\r\n		<li>\r\n			Custom Booking System</li>\r\n		<li>\r\n			SEO Optimization</li>\r\n		<li>\r\n			Our Web Hosting Solution</li>\r\n	</ul>\r\n</div>\r\n<!-- COLUMN ENDS-->\r\n<div class=\"one-fourth\">\r\n	<!-- COLUMN STARTS--><img alt=\" \" class=\"img-align-left\" height=\"66\" src=\"/themes/adventure/images/icons/check-box.png\" width=\"66\" />\r\n	<h4>\r\n		Our talented team</h4>\r\n	<p>\r\n		Lorem ipsum dolor sit amet, tollite fit manibus individuationis omnibus civitas ad quia. Quaere allocutus ait regem ut sua etiam quantitas non solutionem invenisti.</p>\r\n	<br />\r\n	<ul class=\"round-list\">\r\n		<li>\r\n			Site Redesign</li>\r\n		<li>\r\n			Custom CMS Developmet</li>\r\n		<li>\r\n			Custom Booking System</li>\r\n		<li>\r\n			SEO Optimization</li>\r\n		<li>\r\n			Our Web Hosting Solution</li>\r\n	</ul>\r\n</div>\r\n<!-- COLUMN ENDS-->\r\n<div class=\"one-fourth last\">\r\n	<!-- COLUMN STARTS--><img alt=\" \" class=\"img-align-left\" height=\"66\" src=\"/themes/adventure/images/icons/display.png\" width=\"66\" />\r\n	<h4>\r\n		How to Apply?</h4>\r\n	<p>\r\n		Lorem ipsum dolor sit amet, tollite fit manibus individuationis omnibus civitas ad quia. Quaere allocutus ait regem ut sua etiam quantitas non solutionem invenisti.</p>\r\n	<br />\r\n	<ul class=\"round-list\">\r\n		<li>\r\n			Site Redesign</li>\r\n		<li>\r\n			Custom CMS Developmet</li>\r\n		<li>\r\n			Custom Booking System<