INSERT INTO `Post` VALUES (1,38,4,'published','Obama 2012 Campaign Turns To Tumblr For â€œHuge Collaborative Storytelling Effortâ€','<p>\r\n	&nbsp;</p>\r\n<div class=\"media-container media-loading\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">\r\n	<img alt=\"obamatumblr-1\" class=\"attachment-post-detail wp-post-image\" height=\"544\" src=\"http://tctechcrunch2011.files.wordpress.com/2011/10/obamatumblr-1.png?w=586\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; max-width: 640px; \" title=\"obamatumblr-1\" width=\"586\" /></div>\r\n<div class=\"body-copy\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">\r\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		President Obama has added a new web service to his repertoire:&nbsp;<a href=\"http://www.tumblr.com/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Tumblr</a>, the hot blogging service that just raised another&nbsp;<a href=\"http://techcrunch.com/2011/09/26/tumblr-raises-85-million-round-from-richard-branson-vcs/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">$85 million</a>&nbsp;in funding. You can find the new blog&nbsp;<a href=\"http://barackobama.tumblr.com/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">right here</a>.</p>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		The site was set up by the 2012 Obama/Biden campaign, which also runs his&nbsp;<a href=\"https://www.facebook.com/barackobama\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Facebook page</a>&nbsp;and<a href=\"https://twitter.com/#!/barackobama\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Twitter</a>&nbsp;account (The White House also recently&nbsp;<a href=\"http://techcrunch.com/2011/08/15/obama-checks-in-you-can-now-follow-our-president-on-foursquare/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">launched</a>&nbsp;an account on&nbsp;<a href=\"https://foursquare.com/whitehouse\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Foursquare</a>).</p>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		Tumblr is generally known for having a youngish audience (particularly teens), and its reblog feature will help anything the campaign posts spread like wildfire across the service. The folks at Tumblr are undoubtedly smiling &mdash;&nbsp;the President&rsquo;s presence can be worn as a badge of honor, and also generally leads to plenty of free mainstream press coverage.</p>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		In the first post on his blog, Obama&rsquo;s team writes that they want Tumblr to &ldquo;be a huge collaborative storytelling effort&mdash;a place for people across the country to share what&rsquo;s going on in our respective corners of it and how we&rsquo;re getting involved in this campaign to keep making it better.&rdquo;</p>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		To do this, the site will be accepting submissions via the Tumblr submission feature. Fortunately the campaign isn&rsquo;t being naive &mdash; they&rsquo;ve preemptively asked submitters to think of their mothers before they send anything nasty.</p>\r\n	<blockquote style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0.5in; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-style: italic; \">\r\n		<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-style: italic; font-size: 14px; line-height: 20px; \">\r\n			There will be trolls among you: this we know.&nbsp;We ask only that you remember that we&rsquo;re people&mdash;fairly nice ones&mdash;and that your mother would want you to be polite.</p>\r\n	</blockquote>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n','2011-10-25 02:44:01',NULL,NULL,1),(2,38,5,'published','Amigakit Brings The Amiga Into The 21st Century With New X1000','<p>\r\n	&nbsp;</p>\r\n<div class=\"media-container media-loading\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">\r\n	<img alt=\"whynot\" class=\"attachment-post-detail wp-post-image\" height=\"433\" src=\"http://tctechcrunch2011.files.wordpress.com/2011/10/whynot.jpg?w=640\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; max-width: 640px; \" title=\"whynot\" width=\"640\" /></div>\r\n<div class=\"body-copy\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">\r\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		Amiga, Amiga&hellip; why does that name sound familiar?</p>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		Ah yes,&nbsp;<em style=\"font-style: italic; \">that</em>&nbsp;Amiga. A strong early competitor in the PC wars, Commodore&rsquo;s influential and graphics-heavy OS was unfortunately more or less made extinct by Windows by the early 90s. Yet a core group of enthusiasts has kept a candle burning, and here and there you can still find a functioning machine, zealously maintained by someone who insists that the file system or multitasking kernel are still worth admiring. But would you expect a brand new PC with modern accoutrements and a price tag over $2000?</p>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		That&rsquo;s just what&rsquo;s being put out by Amigakit, which has secured the distribution rights to the long-awaited (by some) X1000 desktop system. It&rsquo;s actually quite a powerhouse. Check out the specs:</p>\r\n	<ul style=\"margin-top: -15px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-right: 0px; padding-left: 30px; \">\r\n		<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 30px; padding-top: 0px; padding-right: 0px; padding-bottom: 10px; padding-left: 0px; list-style-type: square; list-style-position: initial; list-style-image: initial; \">\r\n			Dual-core 2GHz PowerISA CPU (PowerPC architecture)</li>\r\n		<li style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 30px; padding-top: 0px; padding-right: 0px; padding-bottom: 10px; padding-left: 0px; list-style-type: square; list-style-position: initial; list-style-image: initial; \">\r\n			Xena 500MHz XMOS companion processor with Xorro connector</li>\r\n		<li style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 30px; padding-top: 0px; padding-right: 0px; padding-bottom: 10px; padding-left: 0px; list-style-type: square; list-style-position: initial; list-style-image: initial; \">\r\n			AMD Radeon 4650 GPU</li>\r\n		<li style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 30px; padding-top: 0px; padding-right: 0px; padding-bottom: 10px; padding-left: 0px; list-style-type: square; list-style-position: initial; list-style-image: initial; \">\r\n			1GB DDR2 RAM</li>\r\n		<li style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 30px; padding-top: 0px; padding-right: 0px; padding-bottom: 10px; padding-left: 0px; list-style-type: square; list-style-position: initial; list-style-image: initial; \">\r\n			500GB HDD</li>\r\n		<li style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 30px; padding-top: 0px; padding-right: 0px; padding-bottom: 10px; padding-left: 0px; list-style-type: square; list-style-position: initial; list-style-image: initial; \">\r\n			2 PCIe x16 slots, 4 DIMM slots, 4x SATA 2, 10x USB 2.0&lt;</li>\r\n	</ul>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		<a href=\"http://www.osnews.com/story/25251/AmigaOne_X1000_To_Ship_by_Year_s_End_Amiga_Netbook_Announced\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">The rest of the specs are here at OS News</a>, with some supplementary info as well. Okay, so when I say powerhouse, I mean compared to the other Amiga machines out there. But it is, as A-EON (the system designer) says, &ldquo;powerful, modern desktop hardware,&rdquo; though spec-wise it can&rsquo;t stand up to Windows boxes a quarter its price. There&rsquo;s supposedly going to be an Amiga-based netbook arriving in mid-2012 as well if that&rsquo;s more your style.</p>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		Should you buy one and take Amiga lessons? Probably not. But I think it&rsquo;s great that this community is still dedicated enough to produce something like this. It&rsquo;s hardware-software experiments and devices like this that act as a spice in the soup of consumer electronics. There are original ideas here in practice, outdated ones as well, and perhaps they will form a permutation that creates the next Photoshop, or a revolution in multithreading, or who knows what.</p>\r\n	<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n		Unfortunately this quirk of the computing world comes in at &pound;1699 in the UK before VAT. There&rsquo;s no US pricing, and I doubt it&rsquo;s any more lenient. But godspeed, Amiga-lovers.</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n','2011-10-25 02:45:28',NULL,NULL,1),(3,38,4,'published','Sencha Raises $15 Million For Their HTML5 App Development Tools','<p>\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	<img alt=\"\" src=\"http://tctechcrunch2011.files.wordpress.com/2011/10/sencha_logo.png?w=288\" style=\"margin-left: 20px; margin-right: 20px; margin-top: 20px; margin-bottom: 20px; float: left; width: 288px; height: 120px; \" />What a week Sencha is having. Just minutes ago, they announced their new HTML 5 cloud services suite,&nbsp;<a href=\"http://techcrunch.com/2011/10/24/sencha-launches-mobile-html5-cloud-sencha-io/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Sencha.io</a>. Tomorrow morning, the company will announce they&rsquo;ve raised a $15 million Series B.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	The announcement will be made during tomorrow&rsquo;s keynote of their third annual Senchacon.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	So, what&rsquo;s a &ldquo;Sencha&rdquo;? Sencha makes Javascript frameworks and tools for HTML 5 developers. In other words, they make life easier for the people trying to make the web prettier.&nbsp;<a href=\"http://www.sencha.com/products/touch/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Sencha Touch</a>, for example, lets developers quickly add Native app-esque touch gestures to their web apps;&nbsp;<a href=\"http://www.sencha.com/products/animator/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Sencha Animator</a>, meanwhile, lets developers build complex CSS3 animations in the same way as they might build a Flash animation. It&rsquo;s also a type of green tea (specifically, it&rsquo;s green tea made without first grinding the leaves.)</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	This round was led by Jafco Venture, with existing investors Sequoia Capital and Radar Partners participating as well. Sancha previously raised $14 million in their Series A back in June of 2010.</p>\r\n','2011-10-25 02:46:42',NULL,NULL,1),(4,38,4,'published','Video-Sharing Startup Shelby.tv Launches Into Public Beta With New iOS App','<p>\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	<a href=\"http://shelby.tv/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \"><img alt=\"\" src=\"http://tctechcrunch2011.files.wordpress.com/2011/10/shelbytv.jpg?w=288\" style=\"margin-left: 20px; margin-right: 20px; margin-top: 20px; margin-bottom: 20px; float: left; width: 288px; height: 214px; \" />Shelby.tv</a>, the video-sharing startup (and stars of Bloomberg&rsquo;s TechStars reality show), is today exiting out of its private alpha phase and launching into a public beta. The service, founded by&nbsp;Reece Pacheco, Dan Spinosa, Henry Sztul and Joe Yevoli, aggregates the video links your friends are sharing across social networks in order to offer you personalized video recommendations.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	It&rsquo;s now&nbsp;<a href=\"http://itunes.apple.com/us/app/shelby.tv/id467849037?mt=8\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">available in the iTunes app store</a>&nbsp;as a native app for the iPhone or iPad.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	The new service automatically pulls all the videos your friends share on Facebook, Twitter and Tumblr into a curated video channel with videos you can watch, favorite and then re-share. There&rsquo;s also a browser bookmarklet that lets you save any video on the web into Shelby.tv for later viewing. The product is dead-simple to use, and enters into the popular (<a href=\"http://techcrunch.com/2011/07/14/shelby-tv-raises-1-5-million-to-give-you-personalized-channels-of-online-video/www.frequency.com\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">if</a>&nbsp;<a href=\"http://disrupt.techcrunch.com/NYC2011/blog/2011/05/23/deja-is-flipboard-for-video-and-its-very-slick/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">somewhat</a>&nbsp;<a href=\"http://eu.techcrunch.com/2011/05/19/plizy-ipad-app-tries-to-be-a-flipboard-meets-pandora-for-video/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">crowded</a>) personalized video space.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	According to a company&nbsp;<a href=\"http://blog.shelby.tv/post/11862748816/shelbylaunch\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">blog post</a>, the newly launched iOS app has been improved based on user feedback and is now offering improved speed and performance. One notable addition is the new de-duplication feature which smartly removes duplicate copies of videos which have been shared by multiple friends.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	There are also different ways to filter videos in the app&rsquo;s guide &ndash; by your favorites (the &ldquo;like view&rdquo;), by your saved videos (&ldquo;watch later&rdquo; view) and by the &ldquo;timeline view&rdquo; which shows you all the videos your friends are sharing. At any time, you can pull down on the video guide to refresh your recommendations.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	Shelby.tv has $1.73 million in total funding, having most recently received a&nbsp;<a href=\"http://techcrunch.com/2011/07/14/shelby-tv-raises-1-5-million-to-give-you-personalized-channels-of-online-video/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">$1.5 million round this summer</a>, from&nbsp;Avalon Ventures and a number of angels.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	You can learn more about the iOS&rsquo;s app&rsquo;s features in the video below, or<a href=\"http://itunes.apple.com/us/app/shelby.tv/id467849037?mt=8\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">&nbsp;just download it here on iTunes</a>.</p>\r\n<p>\r\n	<span class=\"embed-youtube\" style=\"text-align: center; display: block; \"><iframe class=\"youtube-player\" frameborder=\"0\" height=\"390\" src=\"http://www.youtube.com/embed/e3PtrxwF3EA?version=3&amp;rel=1&amp;fs=1&amp;showsearch=0&amp;showinfo=1&amp;iv_load_policy=1&amp;wmode=transparent\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; max-width: 100%; \" type=\"text/html\" width=\"640\"></iframe></span></p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	&nbsp;</p>\r\n','2011-10-25 02:47:53','2011-10-24 20:10:21',NULL,1),(5,38,1,'published','20 websites that engage users with social media icons and links','<p>\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font: normal normal normal 1.25em/1.5em Verdana, Geneva, sans-serif; color: rgb(0, 0, 0); padding-top: 0px; padding-right: 0px; padding-bottom: 9px; padding-left: 0px; \">\r\n	<span style=\"font-family:arial,helvetica,sans-serif;\"><a href=\"http://netdna.webdesignerdepot.com/uploads/2011/06/wdsm_thumb02.png\" style=\"color: rgb(158, 7, 40); text-decoration: underline; font-weight: bold; word-wrap: break-word; \"><img alt=\"\" class=\"alignleft size-full wp-image-24144\" height=\"160\" src=\"http://netdna.webdesignerdepot.com/uploads/2011/06/wdsm_thumb02.png\" style=\"display: inline-block; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; padding-top: 4px; padding-right: 4px; padding-bottom: 4px; padding-left: 0px; max-width: 100%; border-top-style: none; border-right-style: none; border-bottom-style: none; border-left-style: none; border-width: initial; border-color: initial; float: left; margin-top: 0px; margin-right: 7px; margin-bottom: 2px; margin-left: 0px; vertical-align: bottom; \" title=\"wdsm_thumb02\" width=\"200\" /></a>The topic of social media is all over the web, and it is important to consider it when designing a website.</span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font: normal normal normal 1.25em/1.5em Verdana, Geneva, sans-serif; color: rgb(0, 0, 0); padding-top: 0px; padding-right: 0px; padding-bottom: 9px; padding-left: 0px; \">\r\n	<span style=\"font-family:arial,helvetica,sans-serif;\">The way you display&nbsp;<strong>social media icons or links</strong>&nbsp;has a direct effect on user engagement.</span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font: normal normal normal 1.25em/1.5em Verdana, Geneva, sans-serif; color: rgb(0, 0, 0); padding-top: 0px; padding-right: 0px; padding-bottom: 9px; padding-left: 0px; \">\r\n	<span style=\"font-family:arial,helvetica,sans-serif;\">You have to consider many details when laying out a page, including the layout, the flow of content and the main area of rest on the page.</span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font: normal normal normal 1.25em/1.5em Verdana, Geneva, sans-serif; color: rgb(0, 0, 0); padding-top: 0px; padding-right: 0px; padding-bottom: 9px; padding-left: 0px; \">\r\n	<span style=\"font-family:arial,helvetica,sans-serif;\">Whether you end up with typographic links in the header or icons in the footer, you should test out colors, shapes, typography and iconography to ensure that your social links are thoughtfully combined, engaging and well designed.</span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font: normal normal normal 1.25em/1.5em Verdana, Geneva, sans-serif; color: rgb(0, 0, 0); padding-top: 0px; padding-right: 0px; padding-bottom: 9px; padding-left: 0px; \">\r\n	<span style=\"font-family:arial,helvetica,sans-serif;\">Here, we&rsquo;ll show you some examples of how websites display their social links so that you can see the variety of options out there. Check them out, and let us know what you think.</span></p>\r\n','2011-10-25 02:50:55','2011-10-24 19:51:55','2011-10-24 19:51:55',0),(6,5,6,'published','Answers to startup legal questions! Yoo hoo','<p>\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 13px; margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n	I&#39;ve received quite a few start-up legal questions, and this month I&#39;m going to address some of the more common ones.</p>\r\n<p style=\"margin-top: 13px; margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n	Before I do that, though, let me give you some advice that anyone who&#39;s ever asked me a legal question has received: You need a good attorney. If you&#39;re going to go to all the time, trouble and expense of&nbsp;<a class=\"kLink\" href=\"http://www.entrepreneur.com/article/59092#\" id=\"KonaLink0\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 0px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; color: green !important; text-decoration: underline !important; cursor: pointer; font-family: inherit !important; border-top-width: 0px !important; border-right-width: 0px !important; border-bottom-width: 0px !important; border-left-width: 0px !important; border-top-style: none !important; border-right-style: none !important; border-bottom-style: none !important; border-left-style: none !important; border-top-color: transparent !important; border-right-color: transparent !important; border-bottom-color: transparent !important; border-left-color: transparent !important; background-image: none !important; background-attachment: initial !important; background-origin: initial !important; background-clip: initial !important; background-color: transparent !important; text-transform: none !important; display: inline !important; font-variant: normal; top: 0px; right: 0px; bottom: 0px; left: 0px; position: static; font-size: inherit !important; \"><font color=\"green\" style=\"color: green !important; font-family: inherit !important; font-size: inherit !important; position: static; \"><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: green; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">starting&nbsp;</span><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: green; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">a&nbsp;</span><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: green; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">business</span></font></a>, you need to make sure your company is structured so that it protects your interests and fits your goals. In addition, if you ever have a legal problem, you&#39;ll need someone knowledgeable to advise you. Attorneys are not as expensive as you might think, and the value you&#39;ll get is significant. For more information, check out &quot;&nbsp;<a href=\"http://www.entrepreneur.com/startingabusiness/startupbasics/legalissues/article51562.html\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; color: rgb(54, 89, 119); text-decoration: none; \">Developing a Solid Relationship with Your Attorney</a>&nbsp;.&quot;</p>\r\n<p style=\"margin-top: 13px; margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n	Now, let&#39;s take a brief look at some common legal startup questions:</p>\r\n<ul style=\"overflow-x: hidden; overflow-y: hidden; \">\r\n	<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n		<b style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">What&#39;s a DBA?</b>&nbsp;&quot;DBA&quot; stands for &quot;doing&nbsp;<a class=\"kLink\" href=\"http://www.entrepreneur.com/article/59092#\" id=\"KonaLink1\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 0px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; color: green !important; text-decoration: underline !important; cursor: pointer; font-family: inherit !important; border-top-width: 0px !important; border-right-width: 0px !important; border-bottom-width: 0px !important; border-left-width: 0px !important; border-top-style: none !important; border-right-style: none !important; border-bottom-style: none !important; border-left-style: none !important; border-top-color: transparent !important; border-right-color: transparent !important; border-bottom-color: transparent !important; border-left-color: transparent !important; background-image: none !important; background-attachment: initial !important; background-origin: initial !important; background-clip: initial !important; background-color: transparent !important; text-transform: none !important; display: inline !important; font-variant: normal; top: 0px; right: 0px; bottom: 0px; left: 0px; position: static; font-size: inherit !important; \"><font color=\"green\" style=\"color: green !important; font-family: inherit !important; font-size: inherit !important; position: static; \"><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: initial; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">business</span></font></a>&nbsp;as,&quot; and it&#39;s is just another name for your business. Sometimes people want to use different corporate and business names. For example, &quot;Jones Inc.&quot; could be the corporate name, with &quot;Bob Jones Landscaping&quot; as the business name. In this case, you would see it described in a legal context as &quot;Jones Inc. doing business as Bob Jones Landscaping.&quot;\r\n		<p style=\"margin-top: 13px; margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n			A reader recently wrote this to me: &quot;My wife incorporated a multimedia business three years ago, and I am starting a voice-over business. Is it more beneficial for me to open as a sole proprietorship or to operate within her multimedia business?&quot; My answer was that he should open his company as a division of his wife&#39;s business, as a DBA. Even though he is using his&nbsp;<a class=\"kLink\" href=\"http://www.entrepreneur.com/article/59092#\" id=\"KonaLink2\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 0px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; color: green !important; text-decoration: underline !important; cursor: pointer; font-family: inherit !important; border-top-width: 0px !important; border-right-width: 0px !important; border-bottom-width: 0px !important; border-left-width: 0px !important; border-top-style: none !important; border-right-style: none !important; border-bottom-style: none !important; border-left-style: none !important; border-top-color: transparent !important; border-right-color: transparent !important; border-bottom-color: transparent !important; border-left-color: transparent !important; background-image: none !important; background-attachment: initial !important; background-origin: initial !important; background-clip: initial !important; background-color: transparent !important; text-transform: none !important; display: inline !important; font-variant: normal; top: 0px; right: 0px; bottom: 0px; left: 0px; position: static; font-size: inherit !important; \"><font color=\"green\" style=\"color: green !important; font-family: inherit !important; font-size: inherit !important; position: static; \"><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: initial; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">own&nbsp;</span><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: initial; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">business</span></font></a>&nbsp;name (the DBA), technically his wife&#39;s corporation is launching the product/service and therefore should give him some liability protection. Doing so would also help him save on startup costs (such as having to pay for a separate incorporation). It&#39;s easy to keep a separate set of books, and when the&nbsp;<a class=\"kLink\" href=\"http://www.entrepreneur.com/article/59092#\" id=\"KonaLink3\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 0px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; color: green !important; text-decoration: underline !important; cursor: pointer; font-family: inherit !important; border-top-width: 0px !important; border-right-width: 0px !important; border-bottom-width: 0px !important; border-left-width: 0px !important; border-top-style: none !important; border-right-style: none !important; border-bottom-style: none !important; border-left-style: none !important; border-top-color: transparent !important; border-right-color: transparent !important; border-bottom-color: transparent !important; border-left-color: transparent !important; background-image: none !important; background-attachment: initial !important; background-origin: initial !important; background-clip: initial !important; background-color: transparent !important; text-transform: none !important; display: inline !important; font-variant: normal; top: 0px; right: 0px; bottom: 0px; left: 0px; position: static; font-size: inherit !important; \"><font color=\"green\" style=\"color: green !important; font-family: inherit !important; font-size: inherit !important; position: static; \"><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: initial; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">new&nbsp;</span><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: initial; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">business</span></font></a>takes off, you can simply spin it off into a separate company.</p>\r\n	</li>\r\n	<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n		<b style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">Should I incorporate in Delaware?</b>&nbsp;There used to be some tax and legal advantages to doing this, particularly if you were a very large corporation with many shareholders. But based on everything I&#39;ve learned, incorporating in Delaware isn&#39;t important for a small startup.</li>\r\n	<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n		<b style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">Will a corporation protect me from liability?</b>&nbsp;It can, if you handle it right. You may have heard about the corporate veil, which means that you can&#39;t be sued personally for anything that happens in the corporation and your personal assets can&#39;t be attacked by creditors or a lawsuit on the corporation. But in order to have this protection, you must act like a corporation. This means having board meetings, taking notes and publishing minutes in your corporate book. In addition, be sure to have a separate corporate checking account and, if you need them, corporate credit cards. Don&#39;t use corporate money for personal things, and vice versa (unless you file an expense report). Many people think they don&#39;t need to go to all this trouble if there&#39;s just one or two people in their company, but in order to be treated like a corporation, you must act like one. Your attorney can give you more details.</li>\r\n	<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n		<b style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">How do I register my company name?</b>&nbsp;Contact the office of the secretary of state for your state. Click&nbsp;<a href=\"http://www.entrepreneur.com/startingabusiness/startupbasics/legalissues/article38918.html\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; color: rgb(54, 89, 119); text-decoration: none; \">here</a>&nbsp;for a listing. Most will have an overview page (often named something like &quot;Name Registration FAQ&quot;), which will tell you all you need to know about how the process works.</li>\r\n	<li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n		<b style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">Do I need a business license?</b>&nbsp;This is a pretty complicated question. However, here are two good articles that will tell you what you need to know: &quot;&nbsp;<a href=\"http://www.entrepreneur.com/homebasedbiz/homebasedbasics/legalissues/article38882.html\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; color: rgb(54, 89, 119); text-decoration: none; \">Business Licenses and Permits</a>&quot; and &quot;&nbsp;<a href=\"http://www.entrepreneur.com/startingabusiness/startupbasics/legalissues/article72786.html\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; color: rgb(54, 89, 119); text-decoration: none; \">Getting Your Startup Paperwork in Order</a>&nbsp;.&quot;</li>\r\n</ul>\r\n<p style=\"margin-top: 13px; margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; outline-width: initial; outline-color: initial; \">\r\n	Remember, tax and corporate laws change all the time and can vary significantly from state to state. If you&#39;re going to be successful in&nbsp;<a class=\"kLink\" href=\"http://www.entrepreneur.com/article/59092#\" id=\"KonaLink4\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 0px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; color: green !important; text-decoration: underline !important; cursor: pointer; font-family: inherit !important; border-top-width: 0px !important; border-right-width: 0px !important; border-bottom-width: 0px !important; border-left-width: 0px !important; border-top-style: none !important; border-right-style: none !important; border-bottom-style: none !important; border-left-style: none !important; border-top-color: transparent !important; border-right-color: transparent !important; border-bottom-color: transparent !important; border-left-color: transparent !important; background-image: none !important; background-attachment: initial !important; background-origin: initial !important; background-clip: initial !important; background-color: transparent !important; text-transform: none !important; display: inline !important; font-variant: normal; top: 0px; right: 0px; bottom: 0px; left: 0px; position: static; font-size: inherit !important; \"><font color=\"green\" style=\"color: green !important; font-family: inherit !important; font-size: inherit !important; position: static; \"><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: initial; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">your&nbsp;</span><span class=\"kLink\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px !important; padding-right: 0px !important; padding-bottom: 1px !important; padding-left: 0px !important; outline-style: none; outline-width: initial; outline-color: initial; border-top-width: 0px !important; border-top-style: none !important; border-top-color: initial !important; border-left-width: 0px !important; border-left-style: none !important; border-left-color: initial !important; border-right-width: 0px !important; border-right-style: none !important; border-right-color: initial !important; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: initial; color: green !important; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; width: auto !important; float: none !important; display: inline !important; font-family: inherit !important; font-size: inherit !important; position: static; \">business</span></font></a>, you&#39;ll need an attorney on your team who can keep up with changes in the laws and tax codes and advise you as you move ahead in your business. This will reduce the chances of some unknown issue blindsiding you, and will also save you money as you use those laws and codes to your best advantage.</p>\r\n','2011-10-25 06:08:48','2011-10-27 10:55:54',NULL,1),(7,5,3,'published','Google+ Resurrects Playback Feature From Wave, Renames It â€œRipplesâ€','<p>\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	Last August,&nbsp;<a href=\"http://techcrunch.com/2010/08/04/wave-goodbye-to-google-wave/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Google asked us all to say good-bye to Google Wave</a>. Some said Wave was ahead of its time, some said that the platform had enough features to sink the Titanic. However, Google today announced some significant updates to its social network, Google+, among them that&nbsp;<a href=\"http://techcrunch.com/2011/10/27/google-apps-users-can-now-hangout-and-more-on-google/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Google Apps users can now sign up for G+</a>&nbsp;&mdash; the integration is finally live. However, one of the features launched today on Google+ seems a throwback to one now-defunct feature of Google Wave, called &ldquo;Playback&rdquo;.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	Yes, today, Google launched its new Google+ Ripples, which will let users &ldquo;re-live&rdquo; the conversations, comments, and sharing that&rsquo;s taken place over the history of their use of Google+.&nbsp;<a href=\"http://googleblog.blogspot.com/2011/10/google-popular-posts-eye-catching.html\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Check out Google&rsquo;s blog post here</a>.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	In other words, Ripples is a &ldquo;visualization tool for public shares and comments&rdquo;, which users can access by simply selecting the &ldquo;View Ripples&rdquo; option in the drop down window to the right of the public post.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	<a class=\"cboxElement\" href=\"http://tctechcrunch2011.files.wordpress.com/2011/10/screen-shot-2011-10-27-at-1-45-54-pm.png\" rel=\"lightbox[443178]\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \"><img 1.45.54=\"\" 2.16.58=\"\" 2011-10-27=\"\" a=\"\" according=\"\" across=\"\" activity=\"\" all.=\"\" also=\"\" alt=\"\" and=\"\" arrows=\"\" as=\"\" at=\"\" been=\"\" better=\"\" blog=\"\" can=\"\" circles=\"\" class=\"aligncenter size-full wp-image-443217\" click=\"\" collective=\"\" diagram=\"\" direction=\"\" events=\"\" extent=\"\" feed=\"\" flowing=\"\" from=\"\" get=\"\" graphical=\"\" has=\"\" heaviest=\"\" height=\"400\" how=\"\" href=\"http://tctechcrunch2011.files.wordpress.com/2011/10/screen-shot-2011-10-27-at-2-16-58-pm.png\" img=\"\" in=\"\" indicating=\"\" initial=\"\" innerconnectedness=\"\" intention=\"\" is=\"\" it=\"\" just=\"\" kind=\"\" larger=\"\" moving=\"\" network=\"\" new=\"\" nifty=\"\" of=\"\" on=\"\" one=\"\" open=\"\" other=\"\" over=\"\" p=\"\" particular=\"\" play=\"\" pops=\"\" post=\"\" quickly=\"\" reach=\"\" rekindle=\"\" rel=\"lightbox[443178]\" representing=\"\" resharing=\"\" ripples=\"\" s=\"\" screen=\"\" see=\"\" seeing=\"\" share=\"\" shared=\"\" sharing=\"\" shot=\"\" shows=\"\" spread=\"\" spreading=\"\" src=\"http://tctechcrunch2011.files.wordpress.com/2011/10/screen-shot-2011-10-27-at-2-16-58-pm.png?w=640&amp;h=400\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; display: block; margin-top: 0px; margin-right: auto; margin-bottom: 0px; margin-left: auto; clear: both; max-width: 640px; \" that=\"\" the=\"\" their=\"\" timeline=\"\" to=\"\" understanding=\"\" users=\"\" viewing=\"\" was=\"\" well=\"\" what=\"\" when=\"\" where=\"\" who=\"\" width=\"640\" with=\"\" within=\"\" zoom=\"\" /></a></p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	Google says that Ripples is still experimental and is looking for feedback on how it can be more informative and &ldquo;more awesome&rdquo;. But so far, so good. And, just to make one thing clear: Yes, Google did name this feature after me. Thank you, Google.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	But the interesting thing here is how similar Google Ripples is to Google Wave&rsquo;s &ldquo;Playback&rdquo; feature, which allowed friends to get caught up on what everyone else in a wave has already been talking about. This was essentially like rewinding the wave to see what happened in the past, with the ability to watch it progress through its many changes. Playback allowed users to jump around and see all the edits sequentially as they progressed in time to take some of the confusion out of the feature-brimming communication platform.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	Another notable update announced today is the so-called &ldquo;Google+ Creative Kit&rdquo;, which in practice is a bit like a suped-up version of Instagram filters. Creative Kit allows a deeper way to edit one&rsquo;s photos on G+, enabling users to sharpen their photos, add text, or overlay that vintage look now so often associated with Instagram and Hipstagram. According to Google, all you need to use Creative Kit is &ldquo;an idea&rdquo;:</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	<span class=\"embed-youtube\" style=\"text-align: center; display: block; \"><iframe class=\"youtube-player\" frameborder=\"0\" height=\"390\" src=\"http://www.youtube.com/embed/RipLoAUUDjc?version=3&amp;rel=1&amp;fs=1&amp;showsearch=0&amp;showinfo=1&amp;iv_load_policy=1&amp;wmode=transparent\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; max-width: 100%; \" type=\"text/html\" width=\"640\"></iframe></span></p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	In the spirit of Halloween, Google has added some limited-time, &ldquo;spooky&rdquo; features to Creative Kit and is launching a photo competition (through the end of October), in which users can share their frightening photos on Google+ with the hashtag &ldquo;#gplushalloween&rdquo;. A panel of celebrity judges will pick their favorite photos and prizes may even be awarded. Though we&rsquo;re checking on that last bit.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	For more on these new Google+ features,&nbsp;<a href=\"http://googleblog.blogspot.com/2011/10/google-popular-posts-eye-catching.html\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">here&rsquo;s the blog post</a>.</p>\r\n','2011-10-27 21:28:30','2011-10-27 14:31:04',NULL,1),(8,5,3,'pending','test','<p>\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	Last August,&nbsp;<a href=\"http://techcrunch.com/2010/08/04/wave-goodbye-to-google-wave/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Google asked us all to say good-bye to Google Wave</a>. Some said Wave was ahead of its time, some said that the platform had enough features to sink the Titanic. However, Google today announced some significant updates to its social network, Google+, among them that&nbsp;<a href=\"http://techcrunch.com/2011/10/27/google-apps-users-can-now-hangout-and-more-on-google/\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Google Apps users can now sign up for G+</a>&nbsp;&mdash; the integration is finally live. However, one of the features launched today on Google+ seems a throwback to one now-defunct feature of Google Wave, called &ldquo;Playback&rdquo;.</p>\r\n<p style=\"margin-top: 12.5px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; \">\r\n	Yes, today, Google launched its new Google+ Ripples, which will let users &ldquo;re-live&rdquo; the conversations, comments, and sharing that&rsquo;s taken place over the history of their use of Google+.&nbsp;<a href=\"http://googleblog.blogspot.com/2011/10/google-popular-posts-eye-catching.html\" style=\"font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; \">Check out Google&rsquo;s blog post here</a>.</p>\r\n','2011-10-27 21:31:26','2011-10-27 15:30:45','2011-10-27 15:30:45',0),(9,5,2,'published','est','&lt;p&gt;\\r\\n	\\\\r\\\\n &amp;nbsp;&lt;/p&gt;\\r\\n&lt;p&gt;\\r\\n	\\\\r\\\\n&lt;/p&gt;\\r\\n&lt;p style=&quot;margin-top: 0px; margin-right: 0px; margin-bottom: 12.5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; font-size: 14px; line-height: 20px; &quot;&gt;\\r\\n	\\\\r\\\\n Last August,&amp;nbsp;&lt;a href=&quot;http://techcrunch.com/2010/08/04/wave-goodbye-to-google-wave/&quot; style=&quot;font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; outline-width: initial; outline-color: initial; &quot;&gt;Google asked us all to say good-bye to Google Wave&lt;/a&gt;. Some said Wave was ahead of its time, some said